IF OBJECT_ID('dbo.proc_transform_223', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_223;
GO
CREATE PROCEDURE dbo.proc_transform_223
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_223
    SET payload = LEFT(payload, 1000) + N'|V4-223|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_223;
END
GO
IF OBJECT_ID('dbo.audit_v4_223', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_223 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_223;
GO

CREATE INDEX IDX_staging_223_payload ON dbo.staging_table_223 (id);
